import React, { useState } from 'react';
import GreenTrendz from '../assets/img/logo_1.png';

import {
  Home,
  LayoutDashboard,
  FileText,
  BarChart2,
  Calculator,
  Settings,
  HelpCircle,
  CloudUpload,
} from 'lucide-react';

const styles = {
  landingPage: {
    display: 'flex',
    height: '100vh',
    backgroundColor: '#f4f4f9',
    fontFamily: 'Arial, sans-serif',
  },
  sidebar: {
    width: '250px',
    background: 'linear-gradient(to bottom right, #064e3b, #276749)',
    color: 'white',
    padding: '20px',
    boxSizing: 'border-box',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'flex-start',
    position: 'fixed',
    height: '100vh',
    zIndex: 10,
    boxShadow: '2px 0 15px rgba(0, 0, 0, 0.15)',
    transition: 'width 0.3s ease',
  },
  logo: {
    fontSize: '25px',
    marginBottom: '30px',
    fontWeight: 'bold',
    color: '#fff',
    textAlign: 'center',
    marginTop: '20px',
    transition: 'transform 0.3s ease',
  },
  navList: {
    listStyle: 'none',
    padding: 0,
    margin: 0,
    width: '100%',
  },
  navItem: {
    color: 'white',
    textDecoration: 'none',
    padding: '15px 20px',
    display: 'flex',
    alignItems: 'center',
    width: '100%',
    borderRadius: '8px',
    marginBottom: '12px',
    transition: 'background-color 0.3s ease, transform 0.3s ease',
    cursor: 'pointer',
    fontFamily: "'Poppins', sans-serif", 
    fontWeight: '500', 
  },
  navIcon: {
    marginRight: '20px',
    transition: 'transform 0.3s ease',
  },
  content: {
    flex: 1,
    padding: '30px',
    boxSizing: 'border-box',
    backgroundColor: '#ffffff',
    overflowY: 'auto',
    marginLeft: '250px',
    transition: 'margin-left 0.3s ease',
  },
  button: {
    backgroundColor: '#4CAF50', 
    color: 'white', 
    border: 'none', 
    padding: '15px 32px', 
    fontSize: '16px', 
    borderRadius: '5px', 
    cursor: 'pointer', 
    boxShadow: '0px 4px 6px rgba(0, 0, 0, 0.1)', 
    transition: 'background-color 0.3s ease, transform 0.2s ease', 
  },
  collapsibleSection: {
    marginBottom: '20px',
    padding: '15px',
    backgroundColor: '#e6f2f1',
    borderRadius: '8px',
    boxShadow: '0px 2px 5px rgba(0, 0, 0, 0.1)',
    cursor: 'pointer',
  },
  sectionContent: {
    display: 'none',
    padding: '10px 20px',
    backgroundColor: '#f4f4f4',
    borderRadius: '8px',
    marginTop: '10px',
  },
};

const menuItems = [
  { icon: Home, label: 'Home', path: '/land' },
  { icon: CloudUpload, label: 'Data Upload', path: '/upload' },
  { icon: LayoutDashboard, label: 'Dashboard', path: '/dashboard' },
  { icon: FileText, label: 'Reports', path: '/reports' },
  { icon: BarChart2, label: 'Comparison', path: '/comparison' },
  { icon: Calculator, label: 'Carbon Calculator', path: '/calculator' },
  { icon: Settings, label: 'Settings', path: '/settings' },
  { icon: HelpCircle, label: 'Help & Support', path: '/help' },
];

const Sidebar = () => {
  const [showLogoutPopup, setShowLogoutPopup] = useState(false);
  const [isSectionOpen, setIsSectionOpen] = useState({
    environmental: false,
    social: false,
    governance: false,
  });
  const [formErrors, setFormErrors] = useState([]);
  const [csvFile, setCsvFile] = useState(null);
  const [logoFile, setLogoFile] = useState(null);

  // Toggle collapsible sections
  const toggleSection = (section) => {
    setIsSectionOpen((prevState) => ({
      ...prevState,
      [section]: !prevState[section],
    }));
  };

  const handleCsvUpload = (e) => {
    const file = e.target.files[0];
    if (file && file.size < 5 * 1024 * 1024 && file.name.endsWith('.csv')) {
      setCsvFile(file);
      setFormErrors([]);
    } else {
      setFormErrors(['Invalid file format or size!']);
    }
  };

  const handleLogoUpload = (e) => {
    const file = e.target.files[0];
    if (file && ['image/png', 'image/jpg', 'image/jpeg', 'image/svg+xml'].includes(file.type) && file.size < 2 * 1024 * 1024) {
      setLogoFile(URL.createObjectURL(file));
      setFormErrors([]);
    } else {
      setFormErrors(['Invalid logo format or size!']);
    }
  };

  return (
    <div style={styles.landingPage}>
      <nav style={styles.sidebar}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img
            src={GreenTrendz}
            alt="Logo"
            width="50"
            height="50"
            className="d-inline-block align-top me-2"
          />
          <h5 style={styles.logo}>GreenTrendz</h5>
        </div>

        <ul style={styles.navList}>
          {menuItems.map((item) => (
            <li key={item.path}>
              <a href={item.path} style={styles.navItem}>
                <item.icon style={styles.navIcon} size={20} />
                <span>{item.label}</span>
              </a>
            </li>
          ))}
        </ul>

        <button
          style={styles.button}
          onClick={() => setShowLogoutPopup(true)}
        >
          Logout
        </button>
      </nav>

      <div style={styles.content}>
        <div style={styles.collapsibleSection} onClick={() => toggleSection('environmental')}>
          <h3>Environmental Data</h3>
        </div>
        {isSectionOpen.environmental && (
          <div style={styles.sectionContent}>
            <input type="number" placeholder="Energy Consumption (kWh)" />
            <input type="number" placeholder="Renewable Energy (%)" />
            <input type="number" placeholder="GHG Emissions (CO2e)" />
            <input type="number" placeholder="Water Usage (liters)" />
          </div>
        )}

        <div style={styles.collapsibleSection} onClick={() => toggleSection('social')}>
          <h3>Social Data</h3>
        </div>
        {isSectionOpen.social && (
          <div style={styles.sectionContent}>
            <input type="number" placeholder="Employee Diversity (%)" />
            <input type="number" placeholder="Employee Engagement (%)" />
            <input type="number" placeholder="Employee Turnover Rate (%)" />
            <input type="number" placeholder="Community Initiatives" />
          </div>
        )}

        <div style={styles.collapsibleSection} onClick={() => toggleSection('governance')}>
          <h3>Governance Data</h3>
        </div>
        {isSectionOpen.governance && (
          <div style={styles.sectionContent}>
            <input type="number" placeholder="Board Diversity (%)" />
            <input type="number" placeholder="Cybersecurity Incidents" />
            <input type="number" placeholder="Compliance Violations" />
            <input type="number" placeholder="CEO Pay Ratio" />
          </div>
        )}

        <div>
          <h3>CSV File Upload</h3>
          <input type="file" accept=".csv" onChange={handleCsvUpload} />
          {csvFile && <div>Preview: {csvFile.name}</div>}
          {formErrors.length > 0 && <div style={{ color: 'red' }}>{formErrors.join(', ')}</div>}
        </div>

        <div>
          <h3>Logo Upload</h3>
          <input type="file" accept=".png,.jpg,.jpeg,.svg" onChange={handleLogoUpload} />
          {logoFile && <img src={logoFile} alt="Logo Preview" width="100" />}
        </div>

        <button
          style={styles.button}
          onClick={() => alert('Form Submitted')}
        >
          Submit
        </button>
      </div>
    </div>
  );
};

export default Sidebar;
